import React from 'react';
import Header from '../Header/Header';
import GridContainer from '../GridContainer';

const Profile = () => {
  return (
    <div>
      <Header/>
    <GridContainer>
      <div>ПІБ</div>
      <div>Курс</div>
      <div>Група</div>
      <div>Факультет/Інститут</div>
      <div>Кафедра</div>
      <div>Спецалізація/пропозиція/блок</div>
      <div>Спеціальність</div>
      <div>Освітня програма</div>
      <div>Рівень навчання</div>
      <div>Форма навчання</div>
      <div>Оплата</div>
    </GridContainer>
    </div>
  );
};

export default Profile;

